    - '1'
    - http://angelsay.ru/publ/kogda_ja_poljubil_sebja/3-1-0-194
    - "Речь на собственное 70-летие"
    - "Когда я полюбил себя, я понял, что тоска и страдания – это только предупредительные
      сигналы о том, что я живу против своей собственной истины.\r\nСегодня я знаю,
      что это называется «Быть самим собой».\r\nКогда я полюбил себя, я понял, как
      сильно можно обидеть кого-то, если навязывать ему исполнение моих же собственных
      желаний, когда время еще не подошло, и человек еще не готов, и этот человек
      – я сам.\r\nСегодня я называю это «Самоуважением».\r\nКогда я полюбил себя,
      я перестал желать другой жизни, и вдруг увидел, что жизнь, которая меня окружает
      сейчас, предоставляет мне все возможности для роста.\r\nСегодня я называю это
      «Зрелость».\r\nКогда я полюбил себя, я понял, что при любых обстоятельствах
      я нахожусь в правильном месте в правильное время, и все происходит исключительно
      в правильный момент.\r\nЯ могу быть спокоен всегда. Теперь я называю это «Уверенность
      в себе».\r\nКогда я полюбил себя, я перестал красть свое собственное время и
      мечтать о больших будущих проектах. Сегодня я делаю только то,\r\nчто доставляет
      мне радость и делает меня счастливым, что я люблю и что заставляет мое сердце
      улыбаться. Я делаю это так, как хочу и в своем собственном ритме.\r\nСегодня
      я называю это «Простота».\r\nКогда я полюбил себя, я освободился от всего, что
      приносит вред моему здоровью – пищи, людей, вещей, ситуаций. Всего,\r\nчто вело
      меня вниз и уводило с моего собственного пути.\r\nСегодня я называю это «Любовью
      к самому себе».\r\nКогда я полюбил себя, я перестал всегда быть правым. И именно
      тогда я стал все меньше и меньше ошибаться.\r\nСегодня я понял, что это «Скромность».\r\nКогда
      я полюбил себя, я прекратил жить прошлым и беспокоиться о будущем.\r\nСегодня
      я живу только настоящим моментом и зову это «Удовлетворением».\r\nКогда я полюбил
      себя, я осознал, что ум мой может мне мешать, что от него можно даже заболеть.
      Но когда я смог связать его с моим сердцем, он сразу стал моим ценным союзником.\r\nСегодня
      я зову эту связь «Мудрость сердца».\r\nНам больше не нужно бояться споров, конфронтаций,
      проблем с самими собой и с другими людьми. Даже звезды сталкиваются, и из их
      столкновений рождаются новые миры.\r\nСегодня я знаю, что это – «Жизнь»."
    - '2'
    - '2011-08-28 13:27:38.304'
    - '2012-01-21 05:10:00.475'
    - 
