    - "Вы есть ваш опыт. Поэтому испытывайте больше. Пока есть возможность, испытывайте
      столько, сколько можете. Настоящий человек никогда не останавливается; настоящий
      человек всегда остаётся бездомным, странником, скитальцем, скитальцем духа.
      Он постоянно остаётся в поиске, он остаётся исследователем, обучающимся – он
      никогда не становится обучившимся. Никогда не спишите стать обучившимся; оставайтесь
      обучающимися. Стать обучившимся – безобразно, оставаться обучающимся безмерно
      прекрасно, в этом благодать, ибо это есть жизнь сама по себе."
