    - "Нельзя достичь успеха в отношениях с другими людьми, не заплатив необходимую
      цену за успех в отношениях с самим собой.\r\nВы можете попытаться улучшить свои
      отношения с другими, используя особые приемы и техники. Но при этом вы можете
      повредить жизненно важные основы своего характера. Не может быть плодов, если
      нет корней. Это принцип очередности: Личная Победа предшествует Общественной
      Победе. Самоуправление и самодисциплина являются основой\r\nхороших отношений
      с другими людьми. \r\nГоворят, что, прежде чем уважать других, надо уважать
      себя. На мой взгляд, эта мысль содержит рациональное зерно. Но если вы себя
      не знаете, если не контролируете себя, если не способны собой управлять, то
      вам очень трудно уважать себя. Ваше уважение в этом случае может быть лишь краткосрочным
      и поверхностным, сходным с самовнушением. \r\nНастоящее самоуважение проистекает
      из умения владеть собой, из истинной независимости. \r\nА это составляет суть
      Навыков 1, 2 и 3. Независимость – это достижение. \r\nВзаимозависимость – это
      выбор, который могут сделать только независимые людьми. Пока мы не пожелаем
      достичь настоящей независимости, бессмысленно развивать свои навыки отношений
      с людьми. Можно, конечно, попытаться. Можно даже добиться некоторого успеха,
      когда небо над головой безоблачно. Но едва настанут тяжелые времена, – а они
      настанут, – окажется, что у нас нет фундамента, на котором все должно держаться"
    - 
