    - "Ежедневное достижение"
    - "Каждый день выполняйте задачу о которой можно рассказать.\r\n\r\nПоставьте
      себе цель (на день, на неделю, или на любой другой промежуток времени). Отслеживая
      её выполнение, вы можете радикально изменить свое поведение — когда начинаете
      искать выдающиеся достижения, вы, сами собой, приходите к процессу оценки и
      приоритизации своих действий на основе значимости для бизнеса.\r\n\r\nОтслеживание
      задачи с разумной периодичностью позволяет быть уверенным в том, что вы не застряли:
      если цель — заканчивать хотя бы одну значимую задачу в день, то вы не можете
      тратить две недели на достижение совершенства в коде.\r\n\r\nНеделя выполненных
      задач\r\n\r\nПонедельник — автоматизировать сборку!\r\nВторник — написать тесты
      кода разбора ленты\r\nСреда — поискать подходящий ORM чтобы не писать sql в
      ручную\r\nЧетверг — начать процесс развертки веб приложения\r\nПятница — исправить
      все предупреждения компилятора\r\n\r\nТакой тип мышления станет скорее привычкой
      нежели усилием. И, как разработчик подсевший на зеленые статусы удачно прошедших
      юнит-тестов, вы начинаете злиться, если не выполнили свою ежедневную задачу.
      Не нужно особо беспокоиться об отслеживании прогресса, потому что работа таким
      способом скорее станет нервным тиком нежели набором задач которые нужно запланировать
      в Microsoft Project."
